    return(
        <button>{ buttonValue }</button>
    );
}

function CalculatorScreen({ displayText }) {
    return(
        <div>
            <p>{ displayText }</p>
        </div>
    );
}

class App extends React.Component {
    render() {
      return (
        <div>
        </div>
      );
    }
}

export default App;
